import { Link } from "react-router-dom";
import classes from "./Landing.module.css";

function Landing() {
  return (
    <div>
      <div className={classes.instruction}>
        Welcome to Trader's Tavern! This tool will help you make decisions on the fly, with the intention
        of being reminisicent of a trader's environment. Build an intuition for probability distributions
        by competing against the Kelly Criterion. For now, the different distributions supported are
        Uniform, Discrete (Sum of multiple dice rolls, approaches Gaussian), and Binomial (Coin flipping).
      </div>
      <ul>
        <Link to="/casual/12">
          <li>Casual</li>
        </Link>
        <Link to="/practical/6">
          <li>Practical</li>
        </Link>
        <Link to="/masochist/3">
          <li>Masochist</li>
        </Link>
      </ul>
    </div>
  );
}

export default Landing;
